import React from 'react';
import { Link } from 'react-router-dom';
import Nav from './Nav';

const Header = () => {
    return (
        <header>
            <h1>Interact with Car Shopping API!</h1>

            <nav>
                <Link to={'/'} className='link'>Click here to read the API documentation</Link>
            </nav>

            <nav>
                <Link to={'/index'} className='link'>Entire record of customers</Link>
            </nav>
            <nav>
                <Link to={'/detail'} className='link'>Single customer information</Link>
            </nav>
            <nav>
                <Link to={'/create'} className='link'>Add new records to the customer database</Link>
            </nav>
            <nav>
                <Link to={'/update'} className='link'>Update a record on the customer database</Link>
            </nav>
        </header>
    )
}

export default Header;
